import { Component, Inject } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector:    'antonio-prova',
  templateUrl: './antonio-prova.component.html',
  styleUrls:  ['./antonio-prova.component.css']
})
export class AntonioProvaComponent {

  public users: Utenti[] = [];

  constructor(http: HttpClient, @Inject('BASE_URL') baseUrl: string) {
    http.get<Utenti[]>('https://localhost:7016/' + 'usersController').subscribe(result => {
      this.users = result;
    }, error => console.error(error));
  }

}

interface Utenti {
  Name:         string;
  Surname:      string;
  Description:  string;
  Email:        string;
  Phone_Number: string;
}
